using RTC.Base; 
using RTC.Interface; 
using System; 

namespace RTC.Core.Extension 
{ 
    public static class ConsoleExtensions 
    { 
        #region Logger 
        #region LogFormat 
        public static void LogFormat(this RTConsole console, string type, string title, string format, params object[] args) 
        { 
            console.Log(type, title, string.Format(format, args)); 
        } 

        public static void LogFormat(this RTConsole console, string type, string format, params object[] args) 
        { 
            console.Log(type, string.Format(format, args)); 
        } 

        public static void LogFormat(this RTConsole console, string format, params object[] args) 
        { 
            console.Log(LogTypes.Log, string.Format(format, args)); 
        } 
        #endregion 

        #region Log 
        public static void Log(this RTConsole console, Log log) 
        { 
            console.Logger.Add(log); 
        } 

        public static void Log(this RTConsole console, string message) 
        { 
            console.Log(LogTypes.Log, message, string.Empty); 
        } 

        public static void Log(this RTConsole console, string title, string message) 
        { 
            console.Log(LogTypes.Log, title, message); 
        } 

        public static void Log(this RTConsole console, object obj) 
        { 
            console.Log(LogTypes.Log, obj?.ToString() ?? "null", string.Empty); 
        } 

        public static void Log(this RTConsole console, string type, string title, string message) 
        { 
            console.Log(new Log(type, title, message)); 
        } 
        #endregion 

        #region LogWarning 
        public static void LogWarning(this RTConsole console, string message) 
        { 
            console.Log(LogTypes.Warning, message, string.Empty); 
        } 

        public static void LogWarning(this RTConsole console, string title, string message) 
        { 
            console.Log(LogTypes.Warning, title, message); 
        } 
        #endregion 

        #region LogError 
        public static void LogError(this RTConsole console, string message) 
        { 
            console.Log(LogTypes.Error, message, string.Empty); 
        } 

        public static void LogError(this RTConsole console, string title, string message) 
        { 
            console.Log(LogTypes.Error, title, message); 
        } 
        #endregion 

        #region LogException 
        public static void LogException(this RTConsole console, string message) 
        { 
            console.Logger.Add(new Log(LogTypes.Exception, message, string.Empty, true)); 
        } 

        public static void LogException(this RTConsole console, string title, string message) 
        { 
            console.Logger.Add(new Log(LogTypes.Exception, title, message, true)); 
        } 
        #endregion 

        #region LogInternal 
        internal static void LogInternal(this RTConsole console, string logType, string message) 
        { 
            if (console.EnableInternalLogs) 
            { 
                console.Log(logType, message, string.Empty); 
            } 
        } 

        internal static void LogInternal(this RTConsole console, string logType, string title, string message) 
        { 
            if (console.EnableInternalLogs) 
            { 
                console.Log(logType, title, message); 
            } 
        } 

        internal static void LogFormatInternal(this RTConsole console, string type, string title, string format, params object[] args) 
        { 
            if (console.EnableInternalLogs) 
            { 
                console.Log(type, title, string.Format(format, args)); 
            } 
        } 

        internal static void LogFormatInternal(this RTConsole console, string type, string format, params object[] args) 
        { 
            if (console.EnableInternalLogs) 
            { 
                console.Log(type, string.Format(format, args)); 
            } 
        } 

        internal static void LogFormatInternal(this RTConsole console, string format, params object[] args) 
        { 
            if (console.EnableInternalLogs) 
            { 
                console.Log(LogTypes.Log, string.Format(format, args)); 
            } 
        } 
        #endregion 

        public static void ClearLogs(this RTConsole console) 
        { 
            console.Logger.Clear(); 
        } 

        #region LogFilters 
        public static void FilterLogsByTitle(this RTConsole console, string prefix) 
        { 
            console.Logger.Filter((Log log) => { return StartsWithIgnoreCase(log.Title, prefix); }); 
        } 
        public static void FilterLogsByMessage(this RTConsole console, string prefix) 
        { 
            console.Logger.Filter((Log log) => { return StartsWithIgnoreCase(log.Message, prefix); }); 
        } 
        public static void FilterLogsByStackTrace(this RTConsole console, bool hasStackTrace) 
        { 
            console.Logger.Filter((Log log) => { return log.HasStackTrace == hasStackTrace; }); 
        } 
        public static void FilterLogsByType(this RTConsole console, string prefix) 
        { 
            console.Logger.Filter((Log log) => { return StartsWithIgnoreCase(log.Type, prefix); }); 
        } 

        private static bool StartsWithIgnoreCase(string str, string prefix) 
        { 
            return str.StartsWith(prefix, StringComparison.OrdinalIgnoreCase); 
        } 
        #endregion 
        #endregion 

        #region TypeConverter 
        public static void AddType(this RTConsole console, ITypeConverter typeConverter) 
        { 
            console.TypeConverters.Add(typeConverter); 
        } 

        public static void ReplaceType(this RTConsole console, ITypeConverter typeConverter) 
        { 
            console.TypeConverters.Replace(typeConverter); 
        } 

        public static ITypeConverter GetConverter(this RTConsole console, Type forType) 
        { 
            return console.TypeConverters.Get(forType); 
        } 
        #endregion 
    } 
}
